import React from "react";

const SearchBox = () => {
  return (
    <div className="pa2">
      <input
        className="pa3 ba b--green bg-lightest-blue"
        type="search"
        placeholder="search robots"
      />
      <input type="submit" value="submit" />
    </div>
  );
};

export default SearchBox;
